import React from "react";
import "bootstrap-icons/font/bootstrap-icons.css";
import samboLogo from "../assets/samboLogo.PNG";
// import { BsFileCode } from "react-icons/bs";
// import { BsBriefcaseFill } from "react-icons/bs";
// import { BsFileEarmarkPerson } from "react-icons/bs";
// import { BsFillPhoneFill } from "react-icons/bs";

function Header() {
  return (
    <header className="header">
      <div id="headerInfo">
        <p id="headerIntro">
          I <span style={{ color: "#00bfff" }}>'</span> M
        </p>
        <p id="headerName">SAM</p>
        <p id="headerTitle">
          <b>FULL STACK SOFTWARE DEVELOPER</b>
        </p>
      </div>
      <div id="headerCircle">
        <img
          id="samboLogo"
          src={samboLogo}
          alt="cartoon logo of Sam LaChapelle"
        />
      </div>
      <div id="headerBio">
        <p id="bioTitle">
          S A M <span style={{ color: "#00bfff" }}>|</span> L A C H A P E L L E
        </p>
        <div id="bioSkillStats">
            <div className="bioSkills">LANGUAGES</div>
            <div className="bioSkills">FRAMEWORKS</div>
            <div className="bioSkills">DATABASES</div>
        </div>
      </div>
    </header>
  );
}

export default Header;
